package main

import (
   "fmt"
   "encoding/hex"
   "strings"
)

var keySeq = []string{"",
"","","",""}

type KeyPad struct {
    CurrPos int
    Code []byte
}

func main() {
    kp := KeyPad{5,make([]byte,len(keySeq))}

    for index,seq := range keySeq {
        kp.Move(index,seq)
    }

    fmt.Println(strings.ToUpper(strings.Join(strings.Split(hex.EncodeToString(kp.Code),"0"),"")))
}

func (kp *KeyPad) Move(index int, seq string) {
    for _,char := range seq {
        switch char {
        case 'U':
            switch kp.CurrPos {
            case 3,13:
                kp.CurrPos -= 2
            case 6,7,8,10,11,12:
                kp.CurrPos -= 4
            }
        case 'D':
            switch kp.CurrPos {
            case 1,11:
                kp.CurrPos += 2
            case 2,3,4,6,7,8:
                kp.CurrPos += 4
            }
        case 'R':
            switch kp.CurrPos {
            case 2,3,5,6,7,8,10,11:
                kp.CurrPos += 1
            }
        case 'L':
            switch kp.CurrPos {
            case 3,4,6,7,8,9,11,12:
                kp.CurrPos -= 1
            }
        }
    }

    kp.Code[index] = byte(kp.CurrPos)
}
